import React, { Component } from 'react'

import '../css/Faqs.css';


class Faqs extends Component {
    render() {
        return (
            this.props.page ? 
                <div className="faqs">
                    <h3>Πώς ξεκινάω την παραγγελία μου;</h3>
                    <p>Εισάγετε τη διεύθυνση σας για να δείτε ποια εστιατόρια διανέμουν φαγητό στην περιοχή σας.</p>
                    <h3>Πώς παραγγέλνω το φαγητό μου online;</h3>
                    <p>Επιλέξτε ένα από τα εστιατόρια που διανέμουν στην περιοχή όπου βρίσκεστε και προσθέστε τα πιάτα που θέλετε στο καλάθι σας.</p>
                    <p>Σε περίπτωση που πρέπει να προσθέσετε υλικά, όπως για παράδειγμα σε μια pizza, θα σας ζητηθεί να τα επιλέξετε.</p>
                    <p>Μόλις ολοκληρώσετε την παραγγελία σας απλά επιλέξτε ολοκλήρωση παραγγελίας και αυτόματα θα αποσταλεί στο εστιατόριο.</p>
                    <h3>Σε πόση ώρα θα φτάσει το φαγητό μου;</h3>
                    <p>Το εστιατόριο θα επιβεβαιώσει το χρόνο παράδοσης ο οποίος θα εμφανιστεί στην οθόνη σας.</p>
                    <h3>Τι γίνεται αν θέλω να κάνω κάποια αλλαγή ή να ακυρώσω την παραγγελία μου;</h3>
                    <p>Με το που λάβετε την επιβεβαίωση της παραγγελίας σας, το εστιατόριο έχει παραλάβει την παραγγελία και έχει ήδη αρχίσει να ετοιμάζει το φαγητό σας. Θα λάβετε και ένα email που θα επιβεβαιώνει την παραγγελία σας.</p>
                    <p>Εάν για οποιοδήποτε λόγο το εστιατόριο δεν μπορεί να δεχτεί την παραγγελία σας, θα ειδοποιηθείτε πριν το τελικό στάδιο της παραγγελίας και θα σας δοθούν οδηγίες.</p>
                    <p>Όταν περιμένετε email από εμάς, βεβαιωθείτε ότι κοιτάξατε και στον φάκελο spam (ανεπιθύμητη αλληλογραφία) σε περίπτωση που κατέληξε εκεί.</p>
                    <h3>Πληρώνω περισσότερο όταν παραγγέλνω από το e-food;</h3>
                    <p>Όχι, πληρώνετε ακριβώς ότι θα πληρώνατε παραγγέλλοντας από το τηλέφωνο. Οι υπηρεσίες του e-food σας παρέχονται εντελώς δωρεάν.</p>
                    <h3>Χρειάζομαι πιστωτική κάρτα;</h3>
                    <p>Yπάρχει η δυνατότητα να πληρώσετε είτε με πιστωτική κάρτα, είτε παραδοσιακά στην πόρτα σας.</p>
                </div>  
            :
                null       
        );
    }
}
export default Faqs;
